import axios from 'axios';
import React, { useEffect, useState } from 'react'

const MenuInfo = () => {
    const parametros=useParams()
    const [infomenu,setinfomenu]=useState(Object)
    async function datosMenu(){
        const respuesta=await axios.get("http://192.168.1.4:8080/menus/get?NombreMenu="+parametros.nombreMenu)
        setinfomenu(respuesta.data)
    }

    useEffect(()=>{
        datosMenu();
      },[]);
  return (
    <div className='infoMenu'>
        <div className='headeinfoMenu'>
            <h1>Nombre </h1>

        </div>
    </div>
  )
}

export default MenuInfo
